import React from 'react';
import { motion } from 'framer-motion';
import { useInView } from 'react-intersection-observer';
import { FiAward, FiCalendar, FiExternalLink } from 'react-icons/fi';
import './Certifications.css';

const Certifications = () => {
  const [ref, inView] = useInView({
    threshold: 0.1,
    triggerOnce: true
  });

  const certifications = [
    {
      id: 1,
      title: "IBM AI & ML Certificate",
      issuer: "IBM",
      date: "May 2025",
      description: "Completed IBM's learning path with courses on Python, ML, DL with GPUs, Business Intelligence, and AI Analyst tools.",
      skills: ["Python", "Machine Learning", "Deep Learning", "Business Intelligence", "AI Tools"],
      link: "#",
      featured: true
    },
    {
      id: 2,
      title: "Building Chatbots with IBM Watson – Cognitive AI",
      issuer: "IBM",
      date: "October 2023",
      description: "Trained in creating enterprise-grade conversational bots using IBM Watson's cognitive AI capabilities.",
      skills: ["IBM Watson", "Chatbots", "Cognitive AI", "NLP", "Enterprise Solutions"],
      link: "#",
      featured: true
    },
    {
      id: 3,
      title: "Machine Learning Summer Training",
      issuer: "Cipher Schools",
      date: "July 2024",
      description: "Hands-on training in SVM, image classification, and model deployment with real-world applications.",
      skills: ["SVM", "Image Classification", "Model Deployment", "Hands-on Training"],
      link: "#",
      featured: true
    }
  ];

  return (
    <section id="certifications" className="certifications section" ref={ref}>
      <div className="container">
        <motion.div
          className="section-header"
          initial={{ opacity: 0, y: 30 }}
          animate={inView ? { opacity: 1, y: 0 } : {}}
          transition={{ duration: 0.6 }}
        >
          <h2>Certifications</h2>
          <p className="section-subtitle">
            Professional credentials and specialized training
          </p>
        </motion.div>

        <div className="certifications-grid">
          {certifications.map((cert, index) => (
            <motion.div
              key={cert.id}
              className="certification-card"
              initial={{ opacity: 0, y: 30 }}
              animate={inView ? { opacity: 1, y: 0 } : {}}
              transition={{ duration: 0.6, delay: index * 0.1 }}
              whileHover={{ y: -8 }}
            >
              <div className="cert-header">
                <div className="cert-icon">
                  <FiAward size={24} />
                </div>
                <div className="cert-meta">
                  <span className="cert-issuer">{cert.issuer}</span>
                  <span className="cert-date">
                    <FiCalendar size={14} />
                    {cert.date}
                  </span>
                </div>
              </div>

              <div className="cert-content">
                <h3 className="cert-title">{cert.title}</h3>
                <p className="cert-description">{cert.description}</p>
                
                <div className="cert-skills">
                  {cert.skills.map((skill, skillIndex) => (
                    <span key={skillIndex} className="skill-tag">
                      {skill}
                    </span>
                  ))}
                </div>
              </div>

              <div className="cert-actions">
                <a
                  href={cert.link}
                  target="_blank"
                  rel="noopener noreferrer"
                  className="cert-link"
                >
                  <FiExternalLink size={18} />
                  View Certificate
                </a>
              </div>
            </motion.div>
          ))}
        </div>

        <motion.div
          className="certifications-cta"
          initial={{ opacity: 0, y: 30 }}
          animate={inView ? { opacity: 1, y: 0 } : {}}
          transition={{ duration: 0.6, delay: 0.8 }}
        >
          <div className="cta-content">
            <h3>Continuous Learning</h3>
            <p>
              I'm committed to staying current with the latest AI/ML technologies and methodologies. 
              Currently pursuing additional certifications in advanced machine learning and cloud platforms.
            </p>
          </div>
        </motion.div>
      </div>
    </section>
  );
};

export default Certifications;
